import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

import { Outlet, Link } from "react-router-dom";

function nav() {
  return (<div>
    <Navbar bg="dark" expand="lg">
    <Container>


     <Navbar className="text-light" href="#home" >
          <Link className="text-light text-decoration-none " to='Home'>Home</Link>
      </Navbar>

      <Navbar className="text-light" href="#home" >
          <Link className="text-light text-decoration-none " to='Show2'>SuperHeroes</Link>
      </Navbar>

      {/* <Navbar.Brand className="text-light " href="./index_villano.js" >
          <Link className="text-light text-decoration-none " to='Show'>Villanos</Link>
     </Navbar.Brand> */}


    </Container>

  </Navbar>
  <Outlet />
 </div> );
}

export default nav;
